import React, {Document} from 'react';
import {Navbar, NavDropdown, FormControl, Nav, Form, Button, Container} from 'react-bootstrap';
import { Component } from 'react';

class FromWarga extends Component{
    render(){
        return(
            <div>
                <Navbar className="navbar navbar-expand navbar-white navbar-light" bg="light" expand="lg">
                    <Navbar.Brand href="#home">e-Komunitas</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                        <Nav.Link href="#home">Home</Nav.Link>
                        <Nav.Link href="#link">Link</Nav.Link>
                        </Nav>
                        <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                        </Form>
                    </Navbar.Collapse>
                </Navbar>
                <Container>
                    <p>Tara</p>
                </Container>
            </div>
        );
    }
}

export default FromWarga;
